var ai_tb = document.getElementById('ai-textbox');
var us_tb = document.getElementById('user-textbox');
var ai_lp = document.getElementById('last_ai_word');
var us_lp = document.getElementById('last_user_word');


var firstTurn = true;
var previousUserWords = [];
var previousAIWords = [];

function display_ai_guess(word) {
    ai_tb.value = word;
    bold();
    setTimeout(() => { hide_words(); unbold();}, 2000);
}

function invalid_word() {
    us_tb.style.color = 'red';
    setTimeout(() => { hide_words(); us_tb.style.fontWeight = null; us_tb.style.color = null;}, 2000);
}

function hide_words() {
    ai_tb.value = "";
    us_tb.value = "";
}

function bold() {
    ai_tb.style.fontWeight = "900";
    us_tb.style.fontWeight = "900";
}

function unbold() {
    ai_tb.style.fontWeight = null;
    us_tb.style.fontWeight = null;
}

function last_pair(user_word, ai_word) {
    ai_lp.innerHTML = ai_word;
    us_lp.innerHTML = user_word;
}

function getDifferentWord(wordList){
    let word;
    for (var i=0; i<wordList.length; i++){
        let same_root = false;
        word = wordList[i]["word"];
        for (var j=0; j<previousUserWords.length; j++) {
            if (stemmer(word) == stemmer(previousUserWords[j])) {
                same_root = true;
                break
            }
        }
        for (var j=0; j<previousAIWords.length; j++) {
            if (stemmer(word) == previousAIWords[j]) {
                same_root = true;
                break
            }
        }
        if (!same_root) {
            break
        } else {
            console.log("was going to guess: " + word)
        }
    }
    return word;
}


function converged(userWord, aiWord) {
    if (stemmer(userWord) == stemmer(aiWord)) {
        confetti.start();
        $('#congrats').css('display','block');
        $('#convergedword').html(userWord);
        setTimeout(() => {confetti.stop(); }, 5000);
    }
}

function updateLastWords(previousUserWords, previousAIWords) {
    if (previousUserWords.length == 1 ) {
        $('#firstuser').html(previousUserWords[0])
        $('#firstai').html(root2word[previousAIWords[0]])
    } else if (previousUserWords.length == 2 ) {
        $('#firstuser').html(previousUserWords[previousUserWords.length-1])
        $('#firstai').html(root2word[previousAIWords[previousUserWords.length-1]])
        $('#seconduser').html(previousUserWords[previousUserWords.length-2])
        $('#secondai').html(root2word[previousAIWords[previousUserWords.length-2]])
    } else {
        $('#firstuser').html(previousUserWords[previousUserWords.length-1])
        $('#firstai').html(root2word[previousAIWords[previousUserWords.length-1]])
        $('#seconduser').html(previousUserWords[previousUserWords.length-2])
        $('#secondai').html(root2word[previousAIWords[previousUserWords.length-2]])
        $('#thirduser').html(previousUserWords[previousUserWords.length-3])
        $('#thirdai').html(root2word[previousAIWords[previousUserWords.length-3]])
    }
}

function addDataToChart(user_x, user_y, ai_x, ai_y) {
    embedding_chart.data.datasets[0].data.push({'x': user_x, 'y': user_y})
    embedding_chart.data.datasets[1].data.push({'x': ai_x, 'y': ai_y})
    if (embedding_chart.data.datasets[2].data.length > 0) {
        embedding_chart.data.datasets[2].data.pop()
    }
    if (embedding_chart.data.datasets[3].data.length > 0) {
        embedding_chart.data.datasets[3].data.pop()
    }
    embedding_chart.data.datasets[2].data.push({'x': user_x, 'y': user_y})
    embedding_chart.data.datasets[3].data.push({'x': ai_x, 'y': ai_y})
    embedding_chart.update();
}


function submit_word(input) {
    if(event.key === 'Enter') {
        let userWord =$('#user-textbox').val();
        if (!(stemmer(userWord) in wordVectors["model"])) {
            console.log("We don't recognize '" + userWord + "'");
            invalid_word()
            return null;
        }
        us_tb.value = userWord;
        if (firstTurn) {
            setUpGraph();
            $('#user-textbox').attr("placeholder", "type next word")
            let aiWord = get_first_ai_word()
            display_ai_guess(aiWord);
            firstTurn = false;
            previousAIWords.push(aiWord);
            previousUserWords.push(userWord);
            updateLastWords(previousUserWords, previousAIWords)
            converged(userWord, aiWord);
            user_embedding = Array.from(smallWordVectors["model"][stemmer(userWord)].dataSync())
            ai_embedding = Array.from(smallWordVectors["model"][stemmer(aiWord)].dataSync())
            addDataToChart(user_embedding[0], user_embedding[1], ai_embedding[0], ai_embedding[1]);
        } else {
            let n = previousUserWords.length-1
            wordVectors.average([stemmer(previousUserWords[n]), previousAIWords[n]]).then(aiWords =>{
                let aiWord = getDifferentWord(aiWords)
                console.log(aiWord)
                display_ai_guess(root2word[aiWord]);
                previousAIWords.push(aiWord);
                previousUserWords.push(userWord);
                updateLastWords(previousUserWords, previousAIWords)
                converged(userWord, aiWord);
                user_embedding = Array.from(smallWordVectors["model"][stemmer(userWord)].dataSync())
                ai_embedding = Array.from(smallWordVectors["model"][aiWord].dataSync())
                addDataToChart(user_embedding[0], user_embedding[1], ai_embedding[0], ai_embedding[1]);
            })
        }
    }
}


