function get_first_ai_word(){
    return initial_words_2[Math.floor(Math.random() * initial_words_2.length)];
}

function drawCircle(context, xPos, yPos, radius, color)
{
   //B1. PARAMETERS for shadow and angles.
   var startAngle        = (Math.PI/180)*0;
   var endAngle          = (Math.PI/180)*360;
   context.shadowColor   = "gray";
   context.shadowOffsetX = 0;
   context.shadowOffsetY = 0;
   context.shadowBlur    = 0;

   //B2. DRAW CIRCLE
   context.beginPath();
   context.arc(xPos, yPos, radius, 
               startAngle, endAngle, false);
   context.fillStyle = color;
   context.fill();              
}


$(document).ready(function(){
    let word = initial_words_1[Math.floor(Math.random() * initial_words_1.length)]
    $('#user-textbox').attr("placeholder", "type a random word like: " + word);    
    $('#ai-textbox').attr("placeholder", "your browser will type here...");    
    

    var canvas = document.getElementById('canvas');
    var ctx = canvas.getContext('2d');
        
    // Set display size (css pixels).
    var width = 1800;
    var height = 600
    canvas.style.width = width + "px";
    canvas.style.height = height + "px";

    // Set actual size in memory (scaled to account for extra pixel density).
    var scale = window.devicePixelRatio; // <--- Change to 1 on retina screens to see blurry canvas.
    canvas.width = width * scale;
    canvas.height = height * scale;

    // Normalize coordinate system to use css pixels.
    ctx.scale(scale, scale);

    let context = $('#canvas')[0].getContext('2d');
   
    var numCircles = 800;
    var maxRadius  = 4;
    var minRadius  = 4;
    var colors     = ["#cac8c8"];
    var numColors  =  colors.length;

    // A3. CREATE circles.
    for(var n=0; n<numCircles; n++)
    {
        // A4. RANDOM values for circle characteristics.
        var xPos       =  Math.random()*canvas.width;
        var yPos       =  Math.random()*canvas.height;
        var radius     =  minRadius+(Math.random()*(maxRadius-minRadius));
        var colorIndex =  Math.random()*(numColors-1);
        colorIndex     =  Math.round(colorIndex);
        var color      =  colors[colorIndex];

        // A5. DRAW circle.
        drawCircle(context, xPos, yPos, radius, color);
    }
})

